int s5k33dxx_set_illum_power(uint8_t vcsel_num, uint8_t value_A, uint8_t value_B)
{
	int ret = 0;
	ALOGE("set illum power: %d = %d", value_A, value_B);

	if (driver_ic_type == DRIVER_IC_CXA4016) {
		cxa4016_reglist[17].val = (cxa4016_reglist[17].val & 0xFF) | (value_A << 8);
		cxa4016_reglist[16].val = (cxa4016_reglist[16].val & 0xFF00) | value_B;
	}
	else if (driver_ic_type == DRIVER_IC_PHX3D) {
		phx3d_reglist[19].val = (phx3d_reglist[19].val & 0xFF) | (value_A << 8);
		phx3d_reglist[18].val = (phx3d_reglist[18].val & 0xFF00) | value_B;

		if (value_A > 110 & value_A <= 130) { // different current need adjust light wave
			phx3d_reglist[23].val = (phx3d_reglist[23].val & 0xF0FF) | (0x01 << 8); // TrAS
			phx3d_reglist[22].val = (phx3d_reglist[22].val & 0xFF00) | 0x30;      // AS_W, AS_I
		}
		else if (value_A > 130 & value_A <= 147) {
			phx3d_reglist[23].val = (phx3d_reglist[23].val & 0xF0FF) | (0x03 << 8);
			phx3d_reglist[22].val = (phx3d_reglist[22].val & 0xFF00) | 0x21;
		}
		else if (value_A > 147 & value_A <= 170) {
			phx3d_reglist[23].val = (phx3d_reglist[23].val & 0xF0FF) | (0x05 << 8);
			phx3d_reglist[22].val = (phx3d_reglist[22].val & 0xFF00) | 0x31;
		}
		else if (value_A > 170 & value_A <= 185) {
			phx3d_reglist[23].val = (phx3d_reglist[23].val & 0xF0FF) | (0x03 << 8);
			phx3d_reglist[22].val = (phx3d_reglist[22].val & 0xFF00) | 0x03;
		}
		else if (value_A > 185 & value_A <= 197) {
			phx3d_reglist[23].val = (phx3d_reglist[23].val & 0xF0FF) | (0x0B << 8);
			phx3d_reglist[22].val = (phx3d_reglist[22].val & 0xFF00) | 0x03;
		}
		else if (value_A > 197 & value_A <= 211) {
			phx3d_reglist[23].val = (phx3d_reglist[23].val & 0xF0FF) | (0x0B << 8);
			phx3d_reglist[22].val = (phx3d_reglist[22].val & 0xFF00) | 0x04;
		}
	}

	ret = s5k33dxx_sensor_init();
	if (ret < 0)
		return ret;

	ret = sensor_write_reg_8(0x0100, 0x01);
	if (ret < 0)
		return ret;

    ret = s5k33dxx_set_illum_duty_cycle(duty_cycle);
    if (ret < 0)
        return ret;

	return ret;
}

