int s5k33dxx_get_illum_duty_cycle(uint8_t *duty)
{
    int ret;
    uint16_t inc_value, dec_value;
    
    ret = sensor_read_reg_16(0xF4AC, &dec_value);
    if (ret < 0)
        return ret;
    
    ret = sensor_read_reg_16(0xF49C, &inc_value);
    if (ret < 0)
        return ret;
    
    if ((inc_value == 0) && (dec_value != 0))
    {
        *duty = (uint8_t)(15 - dec_value);
    }
    else if ((inc_value != 0) && (dec_value == 0))
    {
        *duty = (uint8_t)(15 + inc_value);
    }
    else if ((inc_value == 0) && (dec_value == 0))
    {
        *duty = 15;
    }
    
    return ret;
}

int s5k33dxx_set_illum_duty_cycle(uint8_t duty)
{
    int ret = 0;
    uint16_t value = 0;
    uint16_t inc_value, dec_value;

    duty_cycle = duty;

    if (duty == 15)
    {
        ret = sensor_write_reg_16(0xF49C, 0x0000);
        if (ret < 0)
            return ret;
        ret = sensor_write_reg_16(0xF4AC, 0x0000);
        if (ret < 0)
            return ret;
    }
    else if (duty > 15)
    {
        value = (uint16_t)(duty - 15);
        ret = sensor_write_reg_16(0xF4AC, 0x0000);
        if (ret < 0)
            return ret;
        ret = sensor_write_reg_16(0xF49C, value);
        if (ret < 0)
            return ret;
    }
    else if (duty < 15)
    {
        value = (uint16_t)(15 - duty);
        ret = sensor_write_reg_16(0xF49C, 0x0000);
        if (ret < 0)
            return ret;
        ret = sensor_write_reg_16(0xF4AC, value);
        if (ret < 0)
            return ret;
    }

    return ret;
}

