int fm24c128d_eeprom_read(uint16_t offset, uint8_t * buf, uint16_t size)
{
    int ret = 0;
    
    uint8_t cnt;
    uint8_t blocksize = 64;
    uint8_t prog_time = size / blocksize;
    uint8_t lastsize = size % blocksize;
    uint8_t * buf_ptr_r = buf;
    uint32_t addr = offset;

    for (cnt = 0; cnt< prog_time; cnt++)
    {
        ret = eeprom_read(DATA_MEMORY, addr, 2, buf_ptr_r, blocksize);
        addr += blocksize;
        buf_ptr_r += blocksize;
    }
    
    if (lastsize != 0)
    {
        ret = eeprom_read(DATA_MEMORY, addr, 2, buf_ptr_r, lastsize);
    }
    
    return ret;
}

